 #love #tattooedgirls #coronav\u00edrus #tattooist #londontattoos #tribute #tatuatriciitaliane #tatoo #moderntattoo #uktattoo #bresciatattoo #sketchtattoo #padovatattoo #tattooitalia #milanotattoo #londontattoo #thebesttattooartists #iconbeantattoo #tattoo2me"}}]},"shortcode":"B9w5TC_o0WM","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584296130,"dimensions":{"height":1281,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89670281_3143302032381003_1348503956818065381_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=g7JMkGeJrDYAX9RJYh2\u0026oh=7174e2b914bba72758e03e73e5f5f645\u0026oe=5EA11057","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"1650925581"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.91.981.981a/s640x640/89670281_3143302032381003_1348503956818065381_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=g7JMkGeJrDYAX9RJYh2\u0026oh=9baade33d1ab3950e14064f024fb0287\u0026oe=5E9B51CB","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.91.981.981a/s150x150/89670281_3143302032381003_1348503956818065381_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=g7JMkGeJrDYAX9RJYh2\u0026oh=c2ff23de4590a78a420cc1cc182a521b\u0026oe=5EA50FFF","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.91.981.981a/s240x240/89670281_3143302032381003_1348503956818065381_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=g7JMkGeJrDYAX9RJYh2\u0026oh=40e6b08bf670eb10e6fb98cb4d19c5b0\u0026oe=5E9B92F9","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.91.981.981a/s320x320/89670281_3143302032381003_1348503956818065381_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=g7JMkGeJrDYAX9RJYh2\u0 arosincucina #food #foodporn #mind #life #foodie #delicious #homemade #foodstagram #love #foodblogger #foodblog #Ilovefood #bestoftheday #peace #italy #eat #eating #life #instadaily #igers #igersoftheday #foodstyling #foodlove #foodpost #foodphotooftheday #foodpassion #foodlovers #ilovefood #ilovecooking #pizzachallenge"}}]},"shortcode":"B9w3P-UoPUl","edge_media_to_comment":{"count":3},"taken_at_timestamp":1584295057,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/90086475_1159047281093934_507674886880848287_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=V7pPs41z0q0AX_CoWgd\u0026oh=1783ac3fbe50d6637c7baca46d4b2ea4\u0026oe=5E9BE2A9","edge_liked_by":{"count":49},"edge_media_preview_like":{"count":49},"owner":{"id":"25814328978"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/90086475_1159047281093934_507674886880848287_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=V7pPs41z0q0AX_CoWgd\u0026oh=eba678f02f461d29e231964ed1315842\u0026oe=5EA3B21E","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90086475_1159047281093934_507674886880848287_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=V7pPs41z0q0AX_CoWgd\u0026oh=eba4eb7e0a885b8ffac1bd3272de406d\u0026oe=5E9C78B9","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/90086475_1159047281093934_507674886880848287_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=V7pPs41z0q0AX_CoWgd\u0026oh=aae47a54701d29a8ecc0d0e6af96feb1\u0026oe=5EA201F3","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/90086475_1159047281093934_507674886880848287_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=V7pPs41z0q0
